import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Inicio from './components/inicio';
import Registro from './components/registro';
import './css/inicio.css'; // Asegúrate de que la ruta sea correcta en relación con el archivo actual

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/">
            <Inicio />
          </Route>
          <Route exact path="/registro">
            <Registro />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
